void readFile(std::string fileName, std::vector<std::string> & words, int & count)
{
    ifstream file(fileName.c_str());
    if (file.is_open())
    {
        std::vector<std::string>::iterator it = words.begin();
        while (file.good())
        {
            file >> *it;
            ++it;
        }
        file.close();
    }
}
